import React from 'react';
import './HomePage.css';
import './logo2.jpg'; // Import CSS file for styling

const HomePage = () => {
  return (
    <div className="homepage">
      <div className="buttons-container">
        <button className="button"><h3>PHI</h3></button>
        <a href="login"><button className="button" ><h3>Midwife</h3></button></a>
        <button className="button"><h3>Doctor</h3></button>
      </div>
    </div>
  );
}

export default HomePage;
